import React from 'react';
import ArticleIndex from '../articles/ArticleIndex';
import {
    useLocation,
  } from "react-router-dom";
const location = useLocation();
const url = location.pathname;


const Writer = (props) => {
    return (
        <div>
            
            {url === '/writer' && <ArticleIndex 
            logged = {props.logged}/>}
            
            <ArticleDetail/>
        </div>
    );
}

export default Writer;
